var okhttpImport = new JavaImporter();
okhttpImport.importPackage(Packages.okhttp3);

with (okhttpImport) {
	client = new OkHttpClient();
  function sendPutRequest(url, jsonBody, headers) {
    var mediaType = MediaType.parse("application/json; charset=utf-8");
    var requestBody = RequestBody.create(jsonBody, mediaType);

    var requestBuilder = new Request.Builder()
      .url(url)
      .put(requestBody);

    // 添加统一的请求头
    for (var headerName in headers) {
      requestBuilder.addHeader(headerName, headers[headerName]);
    }

    var request = requestBuilder.build();

    var response = client.newCall(request).execute();

    try {
      if (!response.isSuccessful()) {
        java.toast("请求失败: " + response.code() + " " + response.message());
      }

      // 处理响应
      var responseBody = response.body().string();
      return responseBody;
    } finally {
      response.close();
    }
  }
